import React from 'react'

const PlanetsDetails=(props)=>{
    let {climate,created,diameter,
        edited,films,gravity,name,
        orbital_period,population,
        rotation_period,surface_water,terrain}=props.planetInfo
    return (
        <div>
            <div>Климат: {climate}</div>
            <div>Дата создания: {created}</div>
            <div>Диаметр: {diameter}</div>
            <div>Орбитальный период: {orbital_period}</div>
            <div></div>
        </div>
    )
}

export default PlanetsDetails;
